import React from "react";
import "./style.css";

// Depending on the current path, this component sets the "active" class on the appropriate navigation link item
function Navbar() {
  return (
    <nav className="navbar navbar-expand-lg" 
         style={{justifyContent: "center", backgroundColor: "#172367"}}>
      <ul style={{listStyleType: "none", textAlign: "center",color: "#ffffff"}}>
       <li><a className="navbar-brand" href="/" style={{ fontFamily: "Sans", fontSize:"45px"}}>
        Employee Directory</a>
      </li>
      <li>
      <span style={{fontSize: "15px"}}>Click on carrots to filter by heading or use the search box to narrow your results.</span>
      </li>

      </ul>
    </nav>
  );
}

export default Navbar;
